        "import matplotlib.pyplot as plt\n",
        "\n",
        "# Plot Close price and Moving Averages\n",
        "plt.figure(figsize=(14, 7))\n",
        "plt.plot(data['Close'], label='Close Price')\n",
        "plt.plot(data['MA20'], label='20-Day MA')\n",
